import React, {Component} from 'react';

class Conn extends Component {
    constructor(props){
        super(props);
    }

    render() {

        var imgUrl_2 = '../img/design.jpg';
        const style_2 = {
            backgroundImage: 'url("'+imgUrl_2+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_3 = '../img/build.png';
        const style_3 = {
            backgroundImage: 'url("'+imgUrl_3+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_4 = '../img/domain.png';
        const style_4 = {
            backgroundImage: 'url("'+imgUrl_4+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_5 = '../img/host.jpg';
        const style_5 = {
            backgroundImage: 'url("'+imgUrl_5+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        var imgUrl_6 = '../img/seotop.jpg';
        const style_6 = {
            backgroundImage: 'url("'+imgUrl_6+'")',
            backgroundSize: 'cover',
            backgroundPosition: 'center center',
        };
        return (
            <li className={this.props.connclass}>
                <div className="timeline-image" style={style_2} >
                </div>
                <div className="timeline-panel">
                    <div className="timeline-heading">
                        <h4>{this.props.conntitle}</h4>
                    </div>
                    <div className="timeline-body">
                        <p className="text-muted">
                            {this.props.conncontent}
                        </p>
                    </div>
                </div>
                <div className={this.props.line} />
            </li>
        );
    }
}

export default Conn;
